  input: '"TEXT","F3XN","C00165688","The transfer of funds to our non-federal accounts
    were for cash flow purposes as noted on the report and were not used to finance
    activities in connection with federal elections or any other allocable administrative
    activity.    Memo entries on Schedule A from Dollars for Democrats, the State
    Party Democratic Victory Fund, and the ASDC Partnership Program reflect the gross
    amounts raised, while the transfers to the North Carolina Democratic Party reflect
    the net amount distributed to the Committee to date.  Accordingly, there will
    always be a difference between the two amounts.  Transfers are made on an as-needed
    basis.  Please note that state party committees have been reporting memo entries
    on Schedule A for contributions received by the joint fundraising program during
    the reporting period in which the contribution was received irrespective of whether
    transfers have been made.    Please note that there were no disbursements disclosed
    on Line 30 because we have not made any disbursements for federal election activity
    nor did we have any employee who spent more than 25% of their time in connection
    with a federal election and/or federal election activity.    There is a memo entry
    disbursement disclosed to Istockphoto.  This vendor is located in Canada.  However,
    our software system is not capable of entering a Canadian Postal Code.  The vendors
    complete address is, therefore, included totally within the street address fields."'
